    false,nt"url": null,nt"notes": "NMFS does not have a GIS-based database
    for all of the pinniped haulout sites in California. Much of the information is
    known through word of mouth or in unpublished literature (e.g., academic research)
    that may be lost over time. In the past, many projects occurring along the California
    coastline included components that impacted marine mammals. However, determining
    whether a project may impact marine mammals, specifically pinnipeds, has been challenging
    for those unfamiliar with pinniped behavior. As a result, NMFS is providing interested
    parties with a map depicting pinniped haul-out areas and rookeries in California.
    By having distribution data available to the public, interested parties may be directed
    to a website that contains the necessary information regarding possible permits
    and will also inform them ifthey need to contact NMFS before starting their project
    (i.e.,, avoid illegal takes under the Marine Mammal Protection Act or Endangered
    Species Act).These points were digitized manually by E.Vandebroek at ESA PWA in
    January 2012 using the coordinates listed on NOAA's National Marine Fisheries Service
    California Pinniped Map (http://swr.nmfs.noaa.gov/psd/rookeryhaulouts/). Only the
    points located within the study reaches for the San Francisco Littoral Cell Coastal
    Regional Sediment Management Plan (CRSMP) were digitized. This dataset is no intended
    for use in any other study area.Dataset was submitted to CSMW as part of the San
    Francisco Littoral Cell Coastal Regional Sediment Management Plan (2012).",nt"license_title":
